		// The format is:
		// K: [key] [modifiers*]
		// modifiers are any of the following in any order:
		//  [clef] [middle=pitch] [transpose=[-]number] [stafflines=number] [staffscale=number][style=style]
		// key is none|HP|Hp|specified_key
